import React from 'react';
import { Routes, Route, Link} from "react-router-dom";
import Home from './Home';
import './styles/App.css';

function App() {
  return(
    <>
    <Header_Top/> 
      <Routes>  
        <Route exact path="/" element={<Home/>} />

      </Routes>
    </>
    );
}
function Header_Top() {
  return(
    <>
    <div>
      <div>DFK Stake</div>
      <div><img src='./logo.png'/></div>
      <div>
        <div>Staking</div>
        <div>About Us</div>
      </div>`
    </div>
    </>
    );
}
export default App;
